import React, { useState } from 'react';

import "./boxSelect.css";

function BoxSelect(props) {
  if(props.value == 1) {
    return (
      <h2>1</h2>
)

  }
  else {
    return (
      <h2>2</h2>
  )
  }
}

export default BoxSelect
